  CONSTRAINT `FKiqmba37vy8n3d6j5isbcjiqkr` FOREIGN KEY (`receiver_id`) REFERENCES `sys_user_info` (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

